import React, { Component } from "react";
import moment from "moment";
export default class SearchHistory extends Component {
  render() {
    return (
      <div>
        {this.props.history.title}
        <br></br>
        {moment(this.props.history.date).format("MMMM Do YYYY, h:mm:ss a")}
      </div>
    );
  }
}
